// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DiplomaRegistry {
    struct Diploma {
        uint id;
        string studentName;
        string course;
        string institution;
        uint date;
        string studentId; // Matricula do aluno
    }

    mapping(bytes32 => Diploma) private diplomas;
    mapping(string => bool) private studentIds; // Para verificar a existência de um diploma por matrícula
    uint private nextId;

    event DiplomaRegistered(bytes32 hash, uint id, string studentName, string course, string institution, uint date, string studentId);
    event RegistrationFailed(string reason);

    function generateDiplomaHash(string memory studentName, string memory course, string memory institution, uint date, string memory studentId) private pure returns (bytes32) {
        return keccak256(abi.encodePacked(studentName, course, institution, date, studentId));
    }

    function registerDiploma(string memory studentName, string memory course, string memory institution, uint date, string memory studentId) public returns (string memory, bytes32) {
        if (studentIds[studentId]) {
            emit RegistrationFailed("Diploma already exists for this student ID.");
            return ("Diploma already exists for this student ID.", 0);
        }

        bytes32 diplomaHash = generateDiplomaHash(studentName, course, institution, date, studentId);
        diplomas[diplomaHash] = Diploma(nextId, studentName, course, institution, date, studentId);
        studentIds[studentId] = true;
        emit DiplomaRegistered(diplomaHash, nextId, studentName, course, institution, date, studentId);
        nextId++;
        return ("Diploma successfully registered.", diplomaHash);
    }

    function getDiploma(bytes32 hash) public view returns (uint, string memory, string memory, string memory, uint, string memory) {
        Diploma memory diploma = diplomas[hash];
        return (diploma.id, diploma.studentName, diploma.course, diploma.institution, diploma.date, diploma.studentId);
    }
}
